import React from 'react'

const Task = props => {
  return (
    <tr>
      <td className="collapsing">
        <div className="ui fitted slider checkbox">
          <input type="checkbox" /> <label></label>
        </div>
      </td>
      <td style={{ backgroundColor: 'rgba(30, 250, 22, 0.2)' }}>
        {props.taskName}
      </td>
      <td style={{ backgroundColor: 'rgba(30, 250, 22, 0.2)' }}>
        {props.taskTime}
      </td>
      <td style={{ backgroundColor: 'rgba(30, 250, 22, 0.2)' }}>
        {props.taskPriority}
      </td>
      <td
        style={{
          textAlign: 'center',
          backgroundColor: 'rgba(30, 250, 22, 0.2)',
        }}
      >
        <input
          style={{
            color: '#1DB7B7 !important',
            backgroundColor: '#1DB7B7 !important',
          }}
          type="checkbox"
        />{' '}
      </td>
    </tr>
  )
}

export default Task
